import { getAlluser } from "../../Service/UserService";

export const Users = async () =>{
    const [userdata, SetData] = useState([]);
    getAlluser = () => {
        getAlluser()
          .then(users => {
            console.log(users)
            this.setState({users})
          });
      }


    if(!userdata){return null}

    return(
        <div className="container">
            <h2>Users</h2>
            <table className="table table-bordered">
                <thead>
                <tr>
                    <th>User Id</th>
                    <th>Firstname</th>
                    <th>Lastname</th>
                    <th>begin date</th>
                    <th>end date</th>
                    <th>hours</th>
                </tr>
                </thead>
                <tbody>
                    {userTable}
                </tbody>
            </table>
        </div>
    )

    
}
